import React,{Component} from "react"
import NINE from "../nl_logo.png";
import {BrowserRouter,Link,browserHistory,Redirect} from "react-router-dom";
import { withRouter } from "react-router";
import { Icon} from 'semantic-ui-react'
import 'semantic-ui/dist/semantic.min.css';
import './empheader.css'



class Empheader extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            idd:this.props.idd,
        }
        // console.log('jjj',this.state.id)
        this.onItemClick=this.onItemClick.bind(this)

    }
    componentDidMount(){
     console.table(this.props);
     this.setState({idd:this.props.idd});  

    }
     onLogoutClic(){
        localStorage.clear();
        window.location="/login"

    }
    onItemClick(){
        // let mid= this.props.mid;
        // console.log(this.state.id,"on click")
        // console.log(this.state.id)
        //console.log(this.props);
        this.props.history.push("/e/"+this.state.idd)
        // this.props.history.push('/manager/8')
        //console.log('iddj',this.state.id)
    }
    render() {
console.log(this.props.mid)

        return (
            <BrowserRouter>
            <header>
                <div>
                    <nav>
                        <div className="header">
                        <Link onClick={this.onItemClick} > <img   src={NINE} alt="nineleaps"/> </Link>

                        <Link onClick={this.onItemClick } style={{marginLeft:"650px"}} > <Icon name='home' />   Home</Link>

                           <Link onClick={this.onLogoutClic} style={{marginInlineStart:"left"}}> <Icon name='sign-out' /> Logout</Link>

                        </div>

                    </nav>

                </div>
            </header>
            </BrowserRouter>

        )
    }
}
export default withRouter(Empheader)
